            transition: max-height .25s cubic-bezier(0, 1, 0, 1);
            max-height: 0;
            visibility: hidden
          }
      
          .bs-BetBreakdown_Body {
            overflow: hidden;
            overflow-y: auto;
            overscroll-behavior: contain
          }
      
          .bs-BetBreakdown_Body::-webkit-scrollbar {
            display: none
