          .aam-AppAdvertModule {
            display: flex;
            flex-direction: column;
            min-width: 360px;
            width: 95vw;
            max-width: 435px;
            padding-left: 25px;
            padding-top: 30px;
            padding-bottom: 20px;
            border-radius: 5px;
            overflow: hidden;
            position: fixed;
            left: 50%;
            top: 50%;
            transform: translate(-50%, -50%);
            z-index: 99;
            align-items: flex-start
          }
      
          .aam-AppAdvertModule:before {
            content: "";
            position: absolute;
            top: 25%;
            left: -25%;
            height: 50%;
            width: 150%;
            background: linear-gradient(90deg, #337761, #1dfcb6, #337761);
            animation: 2.5s aam-AppAdvertModule_Animation linear infinite;
            z-index: -1
          }
      
          .aam-AppAdvertModule:after {
            content: "";
            position: absolute;
            top: 2px;
            right: 2px;
            bottom: 2px;
            left: 2px;
            background-image: linear-gradient(45deg, #185c4c, #2e3c38);
            z-index: -1;
            border-radius: 5px
          }
      
          @keyframes aam-AppAdvertModule_Animation {
            0% {
              transform: rotate(0deg)
            }
      
            to {
              transform: rotate(1turn)
            }
          }
      
          .aam-AppAdvertModule_Official {
            font-size: 14px;
            font-weight: 700;
            color: #fff
          }
      
          .aam-AppAdvertModule_Sportsapp {
            margin-top: 3px;
            font-size: 25px;
            font-weight: 700;
            color: #28ffbb;
            z-index: 1
          }
      
          .aam-AppAdvertModule_Strapline {
            margin-top: 17px;
            font-size: 13px;
            color: #fff;
            max-width: 163px;
            margin-bottom: 15px;
            line-height: 18px
          }
      
          .aam-AppAdvertModule_Download {
            font-size: 10px;
            color: #48dbac;
            display: flex;
            align-items: center;
            margin-top: 10px
          }
      
          .aam-AppAdvertModule_Download:before {
            display: inline-block;
            content: "";
            background-image: url('data:image/png;base64,');
            background-size: cover;
            background-repeat: no-repeat;
            width: 16px;
            height: 14px
          }
      
          .aam-AppAdvertModule_Background {
            background-image: url('data:image/png;base64,');
            background-size: contain;
            background-repeat: no-repeat;
            width: 279px;
            height: 443px;
            position: absolute;
            right: -25px;
            top: -2px
          }
      
          .aam-AppAdvertModule_Cross {
            width: 30px;
            height: 30px;
            position: absolute;
            top: 10px;
            right: 10px;
            cursor: pointer;
            background-repeat: no-repeat
          }
      
          .aam-AppAdvertModule_Download-android {
            padding: 0 20px;
            height: 34px;
            position: relative;
            border-radius: 3px;
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #ffdf1b;
            font-size: 14px;
            font-weight: 700;
            z-index: 2
          }
      
          .aam-AppAdvertModule_Download-android:after {
            content: "";
            display: flex;
            background-position: 100%;
            background-size: 70px 11px;
            background-repeat: no-repeat;
            width: 70px;
            height: 11px;
            margin-left: 4px
          }
      
          .aam-AppAdvertModule_Download-ios {
            width: 126px;
            height: 42px;
            background-position: 50%;
            background-size: contain;
            background-repeat: no-repeat
          }
      
          .aam-AppAdvertModule_DownloadSelected {
            justify-content: center;
            align-items: center;
            max-width: 320px;
            min-width: 320px;
            padding-top: 30px;
            padding-bottom: 30px
          }
      
          .aam-AppAdvertModule_DownloadSelected:before {
            display: none
          }
      
          .aam-AppAdvertModule_Headline {
            font-size: 15px;
            font-weight: 700;
            color: #28ffbb
          }
      
          .aam-AppAdvertModule_Warning {
            font-size: 13px;
            color: #fff;
            padding: 15px 0;
            line-height: 18px;
            text-align: center;
            max-width: 280px
          }
      
          .aam-AppAdvertModule_Ok {
            padding: 8px 40px;
