          .mbl-CastSelectionRacingHorses_Silk {
            flex: 0 0 20px;
            margin-right: 10px;
            display: flex;
            align-items: center
          }
      
          .mbl-CastSelectionRacingHorses_SilkImg {
            display: block;
            width: 20px
          }
      
          .mbl-CastSelectionRacingTrotting_Silk {
            flex: 0 0 20px;
            height: 20px;
            width: 20px;
            margin-right: 10px
          }
      
          .mbl-CastSelectionRacingTrotting_SilkImg {
            display: flex;
