          }
      
          .mbl-CloseBetButtonBase {
            display: flex;
            flex: 1 0 100%;
            text-align: center !important;
            border-bottom-right-radius: 2px;
            border-bottom-left-radius: 2px;
            position: relative;
            height: -webkit-fit-content;
            height: fit-content
          }
      
          .mbl-MyBets_Breakpoints-2 .mbl-CloseBetButtonBase {
            flex: 1 0 50%
          }
      
          .mbl-MyBets_Breakpoints-3 .mbl-CloseBetButtonBase {
            flex: 1 0 33.333%
          }
      
          .mbl-CloseBetButtonBase.mbl-CloseBetButtonSummaryBar {
            flex: 0 0 auto
          }
      
          .mbl-CloseBetButtonBase_Wrapper {
            display: flex;
            padding: 5px 15px 0 10px;
            width: 100%;
            align-items: baseline
          }
      
          .mbl-CloseBetButtonSummaryBar .mbl-CloseBetButtonBase_Wrapper {
            padding: 10px 0 10px 15px
          }
      
          .mbl-MyBets-wide .mbl-CloseBetButtonSummaryBar .mbl-CloseBetButtonBase_Wrapper {
            padding-left: 20px
          }
      
          .mbl-CloseBetButtonBase_WrapperInner {
            display: flex;
            flex: 1 1 auto
          }
      
          .mbl-CloseBetButtonBase_Button {
            width: 100%;
            min-height: 45px;
            padding: 5px 15px;
            border-radius: 5px;
            vertical-align: middle;
            display: flex;
            align-items: center;
            justify-content: center;
            flex: 1 1 auto;
            flex-direction: row;
            background-color: var(--color-grey10)
          }
      
          .allow-hover .mbl-CloseBetButtonBase_Button:hover.mbl-CloseBetButtonBase-cashout {
            background-color: var(--color-white20p)
          }
      
          .mbl-CloseBetButtonBase_Button.mbl-CloseBetButtonBase-cashout {
            cursor: pointer;
            flex-direction: column
          }
      
          .mbl-CloseBetButtonBase_Button.mbl-CloseBetButtonBase-confirm {
            background-color: var(--color-grey8);
            transition: background-color .2s, flex-grow .2s;
            cursor: pointer;
            flex-direction: column
          }
      
          .mbl-CloseBetButtonBase_Button.mbl-CloseBetButtonBase-loading {
            background-color: var(--mbl-color-green-cashing-out);
            cursor: default
          }
      
          .mbl-CloseBetButtonBase_Button.mbl-CloseBetButtonBase-off {
            opacity: .6;
            animation: mbl-CloseBetButtonBase_ErrorShake .5s;
            animation-fill-mode: forwards;
            cursor: default
          }
      
          .mbl-CloseBetButtonBase_Button.mbl-CloseBetButtonBase-suspended {
            background-color: var(--color-grey10);
            opacity: .6;
            cursor: default
