          .mbl-MediaButtonsContainer {
            height: 40px;
            max-height: 40px;
            flex-shrink: 0;
            margin-right: 0
          }
      
          .mbl-MediaButtonWrapper {
            position: relative;
            height: 40px;
            width: 45px;
            display: inline-flex;
            align-items: center;
            justify-content: center;
            cursor: pointer
          }
      
          .mbl-MessageSubHeader {
            display: flex;
            justify-content: center;
            align-items: center;
            color: var(--color-grey7);
            font-size: 11px;
            font-weight: 600;
            font-style: italic;
            line-height: 17px;
            height: 0;
            opacity: 0;
            transition: height .35s, opacity .35s;
            padding-top: 5px
          }
      
          .mbl-OpenBetItem_EditNotAvailable .mbl-MessageSubHeader,
          .mbl-OpenBetItemInnerEdit_Loaded .mbl-MessageSubHeader {
            height: 22px;
            opacity: 1
          }
      
          .mbl-MyBets {
            display: flex;
            flex-direction: column;
            height: 100%
          }
      
          .mbl-MyBets,
          .mbl-MyBets_Container-hasfooter {
            position: relative
          }
      
          .mbl-MyBets-hasfooter {
            margin-bottom: 0
          }
      
          .mbl-MyBets_Container {
            -webkit-backface-visibility: hidden;
            backface-visibility: hidden;
            position: relative;
            transition: transform .5s ease;
            min-height: 100vh;
            margin: 5px 10px 0
          }
      
          .mbl-MyBets-mousemode .mbl-MyBets_Container {
            margin: 5px 30px 0
          }
      
          .mbl-MyBets-wide .mbl-MyBets_Container {
            margin: 0 30px 0 20px
          }
      
          .mbl-MyBetsLegacyModule-inplayview .mbl-MyBets-wide .mbl-MyBets_Container {
            margin: 0 30px
          }
      
          .mbl-MyBets_TaxMessageContainer {
            display: flex;
            justify-content: center;
            margin: 0 10px 5px
          }
      
          .mbl-MyBets-mousemode .mbl-MyBets_TaxMessageContainer {
            margin: 0 30px 5px
          }
      
          .mbl-MyBets-wide .mbl-MyBets_TaxMessageContainer {
            margin: 0 45px 10px 20px
          }
      
          .mbl-MyBets_TaxMessage {
            width: 100%;
            max-width: 1240px;
            text-align: center;
            color: var(--color-grey7);
            line-height: 18px;
            font-size: 11px;
            border-radius: 5px;
            border: 1px solid var(--color-green3-30p);
            padding: 17px 15px
          }
      
          .mbl-MyBets_CashoutMessage {
            padding-top: 5px
          }
      
          .mbl-MyBets_RHSMediaActive {
            flex: 1 0 60%;
            overflow-y: auto;
            overflow-x: hidden
          }
      
          .mbl-MyBets_MyBetsModuleParentRHSMediaActive {
            position: relative;
            display: flex;
            flex: 1 0 100%
          }
      
          .mbl-MyBets_RHSMediaExpandAnimation {
            transition: flex .2s;
            flex-basis: 60%
          }
      
          .mbl-MyBets_RHSMediaBeforeExpandAnimation {
            flex-basis: 100%
          }
      
          .mbl-MyBetsBonusBetIcon {
            padding: 0 10px 10px;
            font-size: 10px;
            border-radius: 1px;
            line-height: 16px;
            color: var(--color-grey1F);
            font-weight: 700;
            font-style: italic;
            display: inline-block
          }
      
          .mbl-MyBets-wide .mbl-MyBetsBonusBetIcon {
            padding: 0 20px 10px
          }
      
          .mbl-MyBetsBonusBetIcon_Title {
            height: 18px;
            text-transform: uppercase;
            padding: 0 3px;
            background-color: var(--color-yellow1);
            border-radius: 1px 0 0 1px;
            display: inline-flex;
            align-items: center
          }
      
          .mbl-MyBetsBonusBetIcon_SettledBetTitle {
            border-radius: 1px
          }
      
          .mbl-MyBetsBonusBetIcon_Message {
            height: 18px;
            background-color: var(--color-grey4F);
            padding: 0 3px;
            display: inline-flex;
            align-items: center;
            color: var(--color-grey8);
            border-radius: 0 1px 1px 0
          }
      
          .mbl-MyBetsBonusBetIcon_CurrencyCode {
            display: inline-flex
          }
      
          .mbl-MyBetsBonusBetIcon_Tick:before {
            content: "";
            display: inline-flex;
            margin-right: 2px;
            width: 12px;
            height: 10px;
            background-repeat: no-repeat;
            background-position: 50%;
            background-size: 12px 10px
          }
      
          .mbl-MyBetsDisabledPopup {
            position: fixed;
            top: 50%;
            left: 50%;
            transform: translateX(-50%) translateY(-50%);
            width: 310px;
            border-radius: 2px;
            z-index: 99;
            background-color: var(--color-grey9);
            color: var(--color-grey3);
            padding: 20px 10px 10px;
            font-weight: 700;
            font-size: 15px
          }
      
          .mbl-MyBetsDisabledPopup_Title {
            text-align: center;
            line-height: 22px;
            padding: 0 10px 10px
          }
      
          .mbl-MyBetsDisabledPopup_Content {
            padding: 0 10px 10px;
            font-weight: 400;
            font-size: 13px;
            text-align: center;
            line-height: 19px
          }
      
          .mbl-MyBetsDisabledPopup_Button {
            height: 45px;
            display: flex;
