          .mbl-OpenBetScores_GoalText {
            color: var(--color-yellow1);
            display: inline-flex
          }
      
          .mbl-OpenBetScores_ScoreSeparator,
          .mbl-OpenBetScores_TennisScore {
            display: inline-block
          }
      
          .mbl-OpenBetSlider {
            z-index: 50;
            text-shadow: none
          }
      
          .mbl-OpenBetSlider_StakeShowing .mbl-OpenBetSlider {
            min-height: 124px
          }
      
          .mbl-OpenBetSlider_Message {
            font-size: 15px;
            line-height: 25px;
            margin: 25px 20px 20px
          }
      
          .mbl-OpenBetSlider_Message,
          .mbl-OpenBetSlider_StakeButton {
            text-align: center;
            color: var(--color-grey3);
            font-weight: 700
          }
      
          .mbl-OpenBetSlider_StakeButton {
            display: block;
            position: absolute;
            z-index: 10;
            border-radius: 2px;
            padding: 0 5px;
            margin: 0;
            line-height: 14px;
            background-color: var(--color-grey9);
            border: 1px solid var(--color-grey5);
            font-size: 12px;
            top: 116px
          }
      
          .mbl-OpenBetSlider_StakeButton.mbl-OpenBetSlider_StakeButtonSelected {
            background-color: var(--color-grey8)
          }
      
          .mbl-OpenBetSlider_StakeButton.mbl-OpenBetSlider_StakeButtonSelected:before {
            border-color: var(--color-grey5) transparent transparent
          }
      
          .mbl-OpenBetSlider_StakeButton.mbl-OpenBetSlider_StakeButtonSelected:after {
            border-color: var(--color-grey8) transparent transparent
          }
      
          .mbl-OpenBetSlider_StakeButton:before {
            top: 153%;
            margin-right: -8px;
            border-width: 5px 5px 0;
            border-color: var(--color-grey5) transparent transparent
          }
      
          .mbl-OpenBetSlider_StakeButton:after,
          .mbl-OpenBetSlider_StakeButton:before {
            position: absolute;
            width: 0;
            height: 2px;
            right: 56%;
            margin-top: -7px;
            padding-top: 1px;
            border-style: solid;
            display: block;
            content: "\00a0"
          }
      
          .mbl-OpenBetSlider_StakeButton:after {
            top: 145%;
            margin-right: -7px;
            border-width: 4px 4px 0;
            border-color: var(--color-grey9) transparent transparent
          }
      
          .mbl-OpenBetSlider_TrackWrapper {
            position: relative;
            left: 0;
            right: 0;
            height: 63px;
            padding: 0 25px;
            margin-bottom: 15px;
            cursor: pointer
          }
      
          .mbl-OpenBetSlider_TrackWrapperStakeShowing.mbl-OpenBetSlider_TrackWrapper {
            margin-top: 6px
          }
      
          .mbl-OpenBetSlider_AutoCashout .mbl-OpenBetSlider_TrackWrapper {
            margin-bottom: 10px
          }
      
          .mbl-OpenBetSlider_Track,
          .mbl-OpenBetSlider_TrackOn,
          .mbl-OpenBetSlider_TrackStake {
            position: absolute;
            left: 20px;
            right: 20px;
            top: 20px;
            height: 5px;
            border-radius: 2.5px
          }
      
          .mbl-OpenBetSlider_Track {
            background-color: var(--color-grey5)
          }
      
          .mbl-OpenBetSlider_TrackOn {
            width: 0;
            background-color: var(--color-green2)
          }
      
          .mbl-OpenBetSlider_TrackWrapperStakeShowing .mbl-OpenBetSlider_TrackOn {
            background-color: var(--color-green1)
          }
      
          .mbl-OpenBetSlider_TrackStake {
            display: none;
            width: 0;
            background-color: var(--color-green2)
          }
      
          .mbl-OpenBetSlider_TrackThumb {
            position: absolute;
            top: 14px;
            left: 0;
            height: 17px;
            width: 17px;
            background-color: var(--color-green2);
            border-radius: 50%;
            z-index: 10;
            background-repeat: no-repeat;
            touch-action: none;
            cursor: pointer;
            margin-left: 6px
          }
      
          .mbl-OpenBetSlider_MinValue {
            bottom: 0;
            left: 20px
          }
      
          .mbl-OpenBetSlider_MaxValue,
          .mbl-OpenBetSlider_MinValue {
            position: absolute;
            font-size: 13px;
            color: var(--color-grey3);
            line-height: 18px;
            margin-bottom: 10px
          }
      
          .mbl-OpenBetSlider_MaxValue {
            bottom: 2px;
            right: 20px
          }
      
          .mbl-OpenBetSlider_AutoCashoutMessage {
            text-align: center;
            font-size: 12px;
            color: var(--color-grey3);
            font-style: italic;
            line-height: 15px;
            margin: 0 20px 25px
          }
      
