          .mbl-MyBetsScroller-enabled {
            overflow-y: auto;
            overflow-x: hidden;
            overscroll-behavior: none;
            -ms-overflow-style: scrollbar;
            scrollbar-width: auto;
            scrollbar-color: var(--color-white20p) var(--color-grey2);
            -webkit-overflow-scrolling: touch;
            height: calc(100% - 50px)
          }
      
          .mbl-MyBetsScroller-enabled::-webkit-scrollbar-track {
            background-color: var(--color-grey2);
            border-left: 1px solid var(--color-grey1);
            border-right: 1px solid var(--color-grey1)
          }
      
          .mbl-MyBetsScroller-enabled::-webkit-scrollbar {
            width: 15px;
            border-left: 1px solid var(--color-grey1);
            border-right: 1px solid var(--color-grey1)
          }
      
          .mbl-MyBetsScroller-enabled::-webkit-scrollbar-thumb {
            cursor: pointer;
            border-radius: 10px;
            background-color: var(--color-white20p);
            border-left: 4px solid transparent;
            border-right: 4px solid transparent;
            border-top: 3px solid transparent;
            border-bottom: 3px solid transparent;
            background-clip: content-box
          }
      
          .g5-Application-hasoverlay .mbl-MyBetsScroller-enabled.mbl-MyBetsScroller-hasmomentum {
            overflow: hidden
          }
      
          .mbl-ArchiveStreamContainer {
            position: relative;
            overflow: hidden;
            max-height: 0
          }
      
          .mbl-ArchiveStreamContainer-loading {
            background-color: #383838
          }
      
          .mbl-ArchiveStreamContainer-loaded {
