            top: 6px
          }
      
          .mbl-TickWithBorder-progress .mbl-TickWithBorder_Tick {
            animation-duration: .5s;
            animation-name: mbl-TickWithBorder_TickGrowIn
          }
      
          .mbl-TickWithBorder-progress .mbl-TickWithBorder_Tick,
